import React from "react";

export default function Attempt({ attempt }) {
    return (
        <tbody>
            <tr>
                <th scope='row'>1</th>
                <td>{attempt.password}</td>
                <td>{attempt.tries}</td>
                <td>{attempt.time} ms</td>
            </tr>
        </tbody>
    );
}
